# ------------
# collatz_read
# ------------

def collatz_read (s) :
    """
    read two ints
    s a string
    return a list of two ints, representing the beginning and end of a range, [i, j]
    """
    a = s.split()
    return [int(a[0]), int(a[1])]

# ------------
# collatz_cycles
# ------------

def collatz_cycles (x) :
	
	global cache
	
	cycles = 1
	while x > 1 :
		
		if(x in cache) :
			return cache[x] + cycles - 1
		elif x % 2 == 0 :
			cache.update({x:collatz_cycles(x >> 1) + 1})
			x = (x >> 1)
		else :
			nx = x + (x >> 1) + 1
			cache.update({x:collatz_cycles(nx) + 2})
			x = nx
			cycles += 1
		cycles += 1
		
	return cycles

# ------------
# collatz_eval
# ------------

def collatz_eval (i, j) :
    """
    i the beginning of the range, inclusive
    j the end       of the range, inclusive
    return the max cycle length of the range [i, j]
    """
    
    global cache
    
    biggest = 0
    for each in range(min(i,j), max(i,j)+1) :
    
    	if each not in cache :
    		x = collatz_cycles(each)
    		cache.update({each:x})
    	else :
    		x = cache[each]    	
    	
    	if x > biggest :
    		biggest = x
    		
    return biggest
    
# -------------
# collatz_print
# -------------

def collatz_print (w, i, j, v) :
    """
    print three ints
    w a writer
    i the beginning of the range, inclusive
    j the end       of the range, inclusive
    v the max cycle length
    """
    w.write(str(i) + " " + str(j) + " " + str(v) + "\n")

# -------------
# collatz_solve
# -------------

def collatz_solve (r, w) :
    """
    r a reader
    w a writer
    """
    
    for s in r :
        i, j = collatz_read(s)
        v    = collatz_eval(i, j)
        collatz_print(w, i, j, v)


